import SearchBar from "../SearchBar/SearchBar"
import styles from "./Nav.module.css"
import { NavLink } from "react-router-dom";

export default function Nav (props) {
    const {buscar} = props;
    return (
    <nav className={styles.navDiv} >
    <img className={styles.navImg} src="https://github.com/tanometro.png" alt="Imagen perfil GitHub Angelo"/>
    <NavLink
    to="/home" 
    className={styles.navItem}>HOME</NavLink>
    <NavLink to="/about" className={styles.navItem}>ABOUT ME</NavLink>
    <SearchBar buscar={buscar}/>     
    </nav>
    )
}
